import React from "react";
import { useNavigate, useParams } from "react-router-dom";
import * as T from "../styles/StyledTalk";

const Talk = () => {
  const navigate = useNavigate();

  const goback = () => {
    navigate(`/`);
  };

  return (
    <T.Container>
      <header>
        <T.Back>
          <img
            id="back"
            src={`${process.env.PUBLIC_URL}/images/Backbtn.svg`}
            alt="back"
          />
        </T.Back>
        <T.Title>솜톡</T.Title>
      </header>
      <footer></footer>
    </T.Container>
  );
};

export default Talk;
